import { useFetch } from "../ts/hooks"

interface Option{
    id: string;
    text: string;
    correct: boolean;
}
interface Quiz {
    id: number;
    name: string;
    username: string;
}
interface Question {
    count: number,
    quiz_id: number,
    id: number | undefined,
    content: string,
    options: Option[],
}
interface FullQuiz{
    quiz: Quiz,
    questions:Question[]
}
interface Props{
    id:number,
}

export default function QuizDisplay(props: Props){
    const { id } = props
    const {data : Quiz} = useFetch<FullQuiz>("quiz/"+id)
    console.log(Quiz)
    return(
        <>
            {Quiz?.quiz.name}
            <div></div>start
        </>
    )
}
